import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Edit oh boi<code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <img  style="width:7%; border-radius:50%" src="{% static 'images/spacex-logo.png' %}" alt="can't flex"/>
      </header>
      <p> where am I </p>
    </div>
  );
}

export default App;
